const myAjax = {
    getAllContacts: async () => {
        let request = new XMLHttpRequest();
        request.open('GET', 'http://localhost:8080/contacts', true);
        request.onload = () => {
            Promise.resolve(JSON.parse(request.responseText));
    };
        request.send();
    }
}

export default myAjax;
